(1, 'Telusuri Kenangan Indah Festival Seribu Warna 2024', 'Festival Seribu Warna', 'Workshop Seni Tradisional', 'Zona Bermain Anak Kreatif', 'https://batarainfo.com/2024/06/warna-khas-dan-seni-tradisional-makassar-bersinar-di-festival-budaya-apeksi-xvii/', 'Festival2024', 'Bergabunglah dalam perjalanan melalui kenangan indah Festival Seribu Warna 2024. Dari hiruk-pikuk pasar kreatif hingga puncak panggung megah, acara ini mempersembahkan keajaiban budaya. Nikmati kuliner lezat, saksikan pertunjukan seni, dan jelajahi momen tak terlupakan. Galeri foto kami menggambarkan kekayaan warna dan kegembiraan yang memenuhi setiap sudut festival. Setiap aksi, senyuman, dan sentuhan magis tersimpan dalam setiap foto. Selamatkan kenangan indah ini bersama kami', 'Bergabunglah dalam workshop seni tradisional dan hadapi keindahan kreativitas dari para seniman terampil. Pelajari teknik dan nilai-nilai budaya yang terkandung dalam setiap karya seni, menciptakan pengalaman belajar yang mendalam.Dalam pertunjukan teater tradisional, penonton akan terhanyut dalam cerita klasik yang dipersembahkan dengan tarian, musik, dan pakaian tradisional. Suatu pengalaman teater yang memukau.', 'Zona bermain anak kreatif dirancang khusus untuk mengeksplorasi kreativitas dan kecerdasan anak-anak. Aktivitas edukatif dan permainan menyenangkan menciptakan suasana belajar yang riang.Sertakan diri Anda dalam lomba fotografi budaya dan tangkap keindahan festival. Dari momen panggung hingga interaksi pengunjung, tunjukkan keahlian fotografi Anda dan raih penghargaan.', 'festival-warna.jpg');

